import React from 'react'
import ReactDOM from 'react-dom'

import {
    App, Time
} from './components'

let nav = (
    <nav>
        <h1>My Website!</h1>
        <ul>
            <li>Pricing</li>
            <li>About</li>
            <li>Contact</li>
        </ul>
    </nav>
)

ReactDOM.render(
    //<div><App/><Time/></div>,
    nav,
    document.getElementById('root')
)
